import React from "react";
import { BrowserRouter } from "react-router-dom/cjs/react-router-dom.min";
import Navbar from "./components/UI/navbar/Navbar";
import './styles/app.css';
import AppRouter from "./components/AppRouter";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <AppRouter/>
    </BrowserRouter>
  )
}

export default App;
